  render: () => <div className="p-8 space-y-8">
      <div>
        <h3 className="text-lg font-semibold mb-4 text-foreground">Available Design Tokens</h3>
        <p className="text-sm text-muted-foreground mb-6">
          These are the design tokens you can use in the controls above. Each token has a CSS variable name and a hex value.
        </p>
        
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
          {/* Border Colors */}
          <div className="space-y-3">
            <h4 className="font-medium text-foreground">Border Colors</h4>
            <div className="space-y-2">
              {Object.entries(TOKEN_MAPPINGS.borderColors).map(([value, label]) => <div key={value} className="flex items-center gap-3 p-2 rounded border bg-background">
                  <div className="w-4 h-4 rounded border-2" style={{
                borderColor: value,
                backgroundColor: value
              }} />
                  <div className="flex-1 min-w-0">
                    <div className="text-sm font-mono text-foreground">{value}</div>
                    <div className="text-xs text-muted-foreground truncate">{String(label)}</div>
                  </div>
                </div>)}
            </div>
          </div>

          {/* Background Colors */}
          <div className="space-y-3">
            <h4 className="font-medium text-foreground">Background Colors</h4>
            <div className="space-y-2">
              {Object.entries(TOKEN_MAPPINGS.backgroundColors).map(([value, label]) => <div key={value} className="flex items-center gap-3 p-2 rounded border bg-background">
                  <div className="w-4 h-4 rounded" style={{
                backgroundColor: value
              }} />
                  <div className="flex-1 min-w-0">
                    <div className="text-sm font-mono text-foreground">{value}</div>
                    <div className="text-xs text-muted-foreground truncate">{String(label)}</div>
                  </div>
                </div>)}
            </div>
          </div>

          {/* Text Colors */}
          <div className="space-y-3">
            <h4 className="font-medium text-foreground">Text Colors</h4>
            <div className="space-y-2">
              {Object.entries(TOKEN_MAPPINGS.textColors).map(([value, label]) => <div key={value} className="flex items-center gap-3 p-2 rounded border bg-background">
                  <div className="w-4 h-4 rounded" style={{
                backgroundColor: value
              }} />
                  <div className="flex-1 min-w-0">
                    <div className="text-sm font-mono text-foreground">{value}</div>
                    <div className="text-xs text-muted-foreground truncate">{String(label)}</div>
                  </div>
                </div>)}
            </div>
          </div>

          {/* Spacing */}
          <div className="space-y-3">
            <h4 className="font-medium text-foreground">Spacing Scale</h4>
            <div className="space-y-2">
              {Object.entries(TOKEN_MAPPINGS.spacing).map(([value, label]) => <div key={value} className="flex items-center gap-3 p-2 rounded border bg-background">
                  <div className="flex items-center gap-2">
                    <div className="w-2 h-2 rounded bg-primary" />
                    <div className="text-xs text-muted-foreground"></div>
                  </div>
                  <div className="flex-1 min-w-0">
                    <div className="text-sm font-mono text-foreground">{value}</div>
                    <div className="text-xs text-muted-foreground truncate">{String(label)}</div>
                  </div>
                </div>)}
            </div>
          </div>

          {/* Border Radius */}
          <div className="space-y-3">
            <h4 className="font-medium text-foreground">Border Radius</h4>
            <div className="space-y-2">
              {Object.entries(TOKEN_MAPPINGS.borderRadius).map(([value, label]) => <div key={value} className="flex items-center gap-3 p-2 rounded border bg-background">
                  <div className="w-4 h-4 border-2 border-primary" style={{
                borderRadius: value
              }} />
                  <div className="flex-1 min-w-0">
                    <div className="text-sm font-mono text-foreground">{value}</div>
                    <div className="text-xs text-muted-foreground truncate">{String(label)}</div>
                  </div>
                </div>)}
            </div>
          </div>
        </div>
      </div>
    </div>,
  parameters: {
    controls: {
      disable: true
    } // Disable controls for this story
  }
